import React from 'react'
import { useParams } from 'react-router-dom'
import { useState, useEffect } from 'react'
import axios from 'axios'

const SpecificDoctor = () => {
    let { docId } = useParams();
    const [specificDoctor, setSpecificDoctor] = useState({});
    useEffect(()=>{
        axios.get(`http://localhost:5001/byId/${docId}`).then((response)=>{
            setSpecificDoctor(response.data)
        })
      },[])

    
  return (
    <div>
        <h1>Specific Doctor</h1>
        <div>{specificDoctor.doctorName}</div>
        <div>{specificDoctor.doctorSpe}</div>
        <div>{specificDoctor.doctorName}</div>
    </div>
  )
}

export default SpecificDoctor
